                                                desc_es:"Este servicio web de datos espaciales contiene información sobre la zona costera correspondiente al Estudio I+D de investigación de recursos hidrogeológicos en Andalucía (cuenca Mediterránea, cuenca Atlántica y Sierra Norte de Sevilla) realizado por la empresa TIHGSA en 2009 para la Agencia Andaluza del Agua (actual Consejería de Agricultura, Pesca y Medio Ambiente) con la intermediación de EGMASA (actual Agencia de Medio Ambiente y Agua). La Tomografía Remota Térmica (TRT) es una técnica de prospección geofísica que aplica la teledetección, junto con la interpretación geológica, hidrogeológica y geofísica para la investigación de recursos hidrogeológicos profundos (hasta 4000 metros de profundidad) a escala regional. Se basa en el análisis de las anomalías que existen en el campo geotérmico terrestre que son reflejadas como una señal geofísica en el campo térmico superficial terrestre, el cual es registrado mediante sensores remotos. El trabajo exige aplicar...",
                                                desc_en:"This online spatial data service contains information about the coastal zone corresponding to the I+D hydrologic resources investigative study in Andalusia (Mediterranean coast, Atlantic coast and Sierra North of Seville), realized by the TIHGSA enterprise in 2009 for the Andalusian Water Agency (currently Ministry of Agriculture, Fishery and Environment) in mediation with EGMASA (currently Water and Environment Agency). The Remote Thermal Tomography (TRT in Spanish) is a geophysical prospection technique using remote sensing and geological, hydrogeological and geophysical interpretation for the investigation of the deep hydrogeological resources (to 4000 meters deep) at a regional scale. It is based upon the analysis of the anomalies existing within the terrestrial superficial thermal field, which is registered thanks to distant sensors. This work requires using...",
                                                desc_fr:"Ce service en ligne de données spatiales contient des informations sur la zone côtière correspondant à l'étude I+D d'investigation des ressources hydrologiques en Andalousie (côte Méditerranée, côte Atlantique et Sierra Nord de Séville), réalisée par l'entreprise TIHGSA en 2009 par l'Agence Andalouse de l'Eau (aujourd'hui Ministère de l'Agriculture, de la pêche et de l'Environnement) en médiation avec EGMASA (aujourd'hui Agence de l'Environnement et de l'Eau). La Tomographie Thermique à Distance est (TRT en espagnol) est une technique de prospection géophysique qui utilise à la fois la télédétection et l'interprétation géologique, hydrogéologique et géophysique pour l'investigation de ressources hydrogéologiques profondes (jusqu'à 4000 mètres de profondeur) à une échelle régionale. Elle se base sur l'analyse des anomalies existant dans le champ géothermique terrestre, qui apparaissent en tant que signal géophysique dans le champ thermique superficiel terrestre, lequel est enregistré grâce à des capteurs éloignés. Ce travail exige d'appliquer... ",
